import React from 'react';

function Food(props) {
  console.log(props);
  return <h3> I Like {props.fav}</h3>;
}

const foodList = [
  {
    name: 'Pasta',
    image : 'https://www.seriouseats.com/2019/08/20190809-burst-tomato-xo-pasta-vicky-wasik21-.jpg',
  },
  {
    name: 'Meat',
    image: 'http://cdn.kormedi.com/wp-content/uploads/2020/03/gettyimages-a11229272.jpg',
  }
];

function App() {
  return (
    <div>
      <h1> Hello!!! </h1>
      { foodList.map(x=> {
        (<Food name={x.name}/>)  
      }) }
    </div>
  ); 
}

export default App;
